      </p>
      <br />
      <div className="center">
        <div className="fa4 br3 bg-shadow=5">
          <input className="f4 pa2 w-40 " type="text" />
          <button className="f4 pa2 w-10 grow link pv2 dib white bg-black ">
            SUBMIT
          </button>
        </div>
      </div>
    </div>
  );
};
export default ImageLinkForm;
